$_MODULE['<{trustedshopsintegration}prestashop>index_a6a2f6c760db4e38332bdd314ca3ad6c'] = 'Trusted Shops invia automaticamente richieste di recensioni sette giorni dopo che un cliente ha effettuato un ordine. L\'attivazione delle richieste di recensioni automatiche riguardo allo stato del PrestaShop ti consente di inviare richieste di recensioni in base allo stato dell\'ordine di PrestaShop da te indicato. (Esempio: Se hai indicato \\\"consegnato\\\" come stato dell\'ordine, l\'email viene inviata non appena l\'ordine riceve lo stato \\\"consegnato\\\".) Ciò ti consente di inviare le richieste di recensioni in un momento ottimale e aumentare in tal modo le tue possibilità di ricevere una recensione eccellente.';
